export const data = {
  PersonaldeInvestigacion: [
    ['Task', 'Hours per Day'],
    ['Categoría 1', 300],
    ['Categoría 2', 150]
  ],
  categorizados: [
    ['Task', 'Categorizados año 2009 - 2011 - 2014'],
    ['Categoría 1', 300],
    ['Categoría 2', 150],
    ['Categoría 3', 110],
    ['Categoría 4', 23],
    ['Categoría 5', 98]
  ],
  opcionescategorizados: {
    chart: {
      title: 'categorizados'
    },
    colors: ['#1b9e77', '#d95f02', '#7570b3'],
    pieHole: 0.2,
    height: 150,
    width: 450
  },
  opcionescategorizados: {
    chart: {
      title: 'categorizados'
    },
    colors: ['#1b9e77', '#d95f02', '#7570b3', '#bfd817', '#d81327'],
    pieHole: 0.2,
    height: 250,
    width: 450
  },
  investigadoressegundedicacion: [
    ['Task', 'Investigadores según cargo'],
    ['Exclusiva', 300],
    ['Semiexclusiva', 150],
    ['Simple', 110]
  ],
  opcionesinvestigadoressegundedicacion: {
    chart: {
      title: 'Investigadores según cargo'
    },
    colors: ['#1b9e77', '#d95f02', '#7570b3'],
    height: 150,
    width: 450
  },
  opcionesinvestigadoressegundedicacion: {
    chart: {
      title: 'Investigadores según cargo'
    },
    colors: ['#1b9e77', '#d95f02', '#7570b3'],
    height: 150,
    width: 450
  }
}
